Candidates should have practical notebooks which should contain records of individual activities based on laboratory and individual observations carried out on the school farms, field trips and also records of specimens collected.  In order to enhance effective teaching/learning process and better performance of candidates, continuous assessment of candidates is recommended. Since the main objectives of the Senior Secondary School Agricultural Science Curriculum are to:

stimulate and sustain students’ interest in agriculture; enable students acquire functional knowledge and practical skills to prepare them for further studies and occupation in agriculture;

it is recommended that the study of Agricultural Science in the Senior Secondary School be supplemented by visits to well established government and private experimental and commercial farms, agricultural research institutes and other institutions related to agriculture.

